import Jizan from '../jizan.png';
import { Transition } from '@headlessui/react'
import { useState } from 'react'

function Home() {

  return (
    <div className="Container w-full h-full my-[10vh] flex flex-col items-center justify-center">
      <div className="top flex flex-col max-h-[50vh] w-full text-left justify-center  md:justify-center md:text-left">

        <h1 className="name text-6xl font-poppins w-full text-left font-bold md:max-w-[500px] my-[1rem] text-white lg:lg:text-6xl lg:leading-snug">
          I'm Jizan Diaz Villafuerte,<br /> <span className="text-[#4ca5ff]">Front-End </span>Developer</h1>
        <p className="font w-full font-poppins font-normal text-lg justify-center text-[#A3B3BC] items-center mt-4 md:max-w-[500px] lg:text-2xl">
          I'm' a Front-End Developer specializing in HTML/CSS, JavaScript and ReactJS.
        </p>

        <div className="w-screen h-[10vh] py-[2vh] flex items-start ">
          <button className="text-white font-bold text-xs bg-[#0b82fa] py-[1.5vh] px-[6vw] rounded-3xl hover:py-[2vh] hover:px-[6.5vw] ease-out duration-100 "> Hire Me!</button>
        </div>
      </div>

    </div>
  );
}




export default Home;
